import React from "react";

function Roster({ detailed, roster }) {
  const rows = roster.map(({ id, firstName }) => {
    <div>
      <ol>
        <li>{id}</li>
        <li>{firstName}</li>
      </ol>
    </div>
  });
  if (!detailed){
    return roster.map(({ id, firstName }) => {
        <div>
          <ol>
            <li>{id}</li>
            <li>{firstName}</li>
          </ol>
        </div>
      });
  } else {
    return roster.map(({ id, firstName, lastName, location }) => {
      <div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Location</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>{id}</td>
            <td>{firstName}</td>
            <td>{lastName}</td>
            <td>{location}</td>
          </tr>
        </tbody>
      </table>
      </div>
    });
  }
}

export default Roster;
